import React from 'react';
import './Skills.css';

const Skills = () => {
    return (
        <section id="skills" className="skills-section">
            <div className="skills-category">
                <h1>Technical <span className='skills'>Skills</span></h1>
            </div>
            <div className="skills-content">
                <h5>Programming Languages</h5>
                <p>JavaScript, Java, Python</p>

                <h5>Markup and Styling Languages</h5>
                <p>HTML, CSS</p>

                <h5>Frameworks and Libraries</h5>
                <p>Node.js, Express.js, React.js, Redux, Redux-toolkit, Bootstrap, UI/UX Design</p>

                <h4>Databases</h4>
                <p>MongoDB, MySQL</p>

                <h4>Version Control Tools</h4>
                <p>GIT</p>

                <h4>IDE/Tools</h4>
                <p>Visual Studio, Postman, MongoDB Compass, Eclipse, Figma</p>

                <h4>Operating Systems</h4>
                <p>Windows 10</p>
            </div>

        </section>
    );
};

export default Skills;
